import p1 from '../src/images/1.jpg';
import p2 from '../src/images/2.jpg';
import p3 from '../src/images/3.jpg';
import p4 from '../src/images/4.jpg';
import p5 from '../src/images/5.jpg';
import p6 from '../src/images/6.jpg';

const Jdata = [
    {
        img_src : p1,
        title : "Product 1",
    },
    {
        img_src : p2,
        title : "Product 2",
    },
    {
        img_src : p3,
        title : "Product 3",
    },
    {
        img_src : p4,
        title : "Product 4",
    },
    {
        img_src : p5,
        title : "Product 5",
    },
    {
        img_src : p6,
        title : "Product 6",
    }
]; 

export default Jdata;
